        public static void CreateAllNorthwindDataIfNotExist()
        {
            Util.Log(LogLevel.Info, "Starting creation of test data...");

            // try read some misc data
            var roles = ClientObjMgr._COM.readDataItems<Role>();
            if (roles.Count == 0)
            {
                Util.Log(LogLevel.Info, "Starting creation of misc objects...");
                CreateMiscTestData();
                Util.Log(LogLevel.Info, "Finished creation of misc objects!");
            }
            else
            {
                Util.Log(LogLevel.Info, "Misc objects had been already created!");
            }

            var states = ClientObjMgr._COM.readDataItems<State>();
            if (states.Count == 0)
            {
                Util.Log(LogLevel.Info, "Starting creation of patient objects...");
                CreatePatientData();
                Util.Log(LogLevel.Info, "Finished creation of patient objects!");
            }
            else
            {
                Util.Log(LogLevel.Info, "Patient objects had been already created!");
            }

            var categories = ClientObjMgr._COM.readDataItems<ProductCategory>();
            if (categories.Count == 0)
            {
                Util.Log(LogLevel.Info, "Starting creation of northwind objects... this will take a couple of minutes...");
                CreateNorthwindData();
                Util.Log(LogLevel.Info, "Finished creation of northwind objects!");
            }
            else
            {
                Util.Log(LogLevel.Info, "Northwind objects had been already created!");
            }

            Util.Log(LogLevel.Info, "Finished creation of all test data!");
        }

