        public static void CreateNorthwindData()
        {
            var shippers = CreateShippers();

            var categories = CreateCategories();

            var suppliers = CreateSuppliers();

            var employees = CreateEmployees();

            var customers = CreateCustomers();

            var products = CreateProducts( categories.ToDictionary(x => x.Name), suppliers.ToDictionary(x => x.Companyname));

            var orders = CreateOrders( customers.ToDictionary(x => x.Companyname), employees.ToDictionary(x => x.Lastname), shippers.ToDictionary(x => x.Companyname));

            var orderLines = CreateOrderLines( orders.ToDictionary(o => o.Orderid), products.ToDictionary(o => o.Name));


            List<DataItem> dItems = new List<DataItem>();
            dItems.AddRange(shippers);
            dItems.AddRange(categories);
            dItems.AddRange(suppliers);
            dItems.AddRange(employees);
            dItems.AddRange(customers);
            dItems.AddRange(products);
            dItems.AddRange(orders);
            dItems.AddRange(orderLines);

            ClientObjMgr._COM.Save(true, TXNAutoInclusion.References, dItems.ToArray());
        }

